import * as React from 'react';
import JqxBarGauge, { IBarGaugeProps } from 'jqwidgets-scripts/jqwidgets-react-tsx/jqxbargauge';
class DVKnobGuage extends React.PureComponent<{}, IBarGaugeProps> {
    constructor(props: {}) {
        super(props);
        this.state = {
            tooltip: {                

                visible: true  
            },
            values: [102, 115, 130, 137]
        };
    }
    public render() {
        return (
            <JqxBarGauge
                // @ts-ignore
                width={'100%'} height={getHeight('barGauge')} max={150}
                colorScheme={'scheme02'} values={this.state.values} 
            />
        );
    }
}
export default DVKnobGuage;
